INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project602582bbeb17b', 'සදහම් වන්දනා - බෝධි පූජාමය පිංකම 2020', 'නව ලියෝ වර්ෂයක ආරම්භය සනිටුහන් කරමින් 306 A2 ලියෝ දිස්ත්‍රික්කයේ නව නිලධාරී මණ්ඩලයට හා සියලුම ලියෝවරුන්ට මෙන්ම කොරෝනා වසංගතයෙන් පීඩාවට පත් ජනතාවට සෙත් පතා ලියෝ දිස්ත්‍රික් 306 A2 ලියෝවරුන් විසින් සංවිධානය කරනු ලැබූ \"සදහම් වන්දනා\" බෝධි පූජාමය පිංකම ජූලි මස 18 වන දින පැපිලියාන සුනේත්‍රාදේවී පිරිවෙන් විහාරස්ථානයේදී පැවැත්විණි. මෙම අවස්ථාවට දිස්ත්‍රික් සිංහාධිපති සිංහ අජිත් ලියනගේ මැතිතුමා සහ එම මැතිනිය සිංහ කාන්තා ශ්‍රියානි ලියනගේ, ලියෝවරුන් සඳහා වූ බහුමණ්ඩල මූලාසනධාරී සිංහ විද්‍යාකීර්ති දිසානායක මැතිතුමා සහ එම මැතිනිය සිංහ කාන්තා අජිතා එදිරිසිංහ, ලියෝ බහුමණ්ඩල සභාපති ලියෝ චම්පක ධම්මගේ, පෙර දිස්ත්‍රික් සභාපතිවරුන් ඇතුළු දිස්ත්‍රික්කයේ අනෙකුත් ලියෝ සමාජ නියෝජනය කරමින් ලියෝවරුන් සහභාගි වුනි. දිස්ත්‍රික් සභාපති ලියෝ ප්‍රමිද වින්දිකගේ නායකත්වය යටතේ මෙම ව්‍යාපෘතිය මෙහෙයවනු ලැබුවේ ව්‍යාපෘති සභාපති ලියෝ ඔසුර පෙරේරා සහ දිස්ත්‍රික්කයේ අනෙකුත් ලියෝ සමාජ සාමාජික සාමාජිකාවන් විසිනි. එකම ලියෝ පවුලක් ලෙසින් මෙම අභිනව වසරේ ලියෝ ගමන් මග එලෙසින් ආශිර්වාදාත්මක ආරම්භයක් සනිටුහන් කරන ලදී.', 'https://www.facebook.com/media/set/?vanity=chathurabandaraphotography&set=a.1232237007116159', '2021-02-11 20:17:15', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project6025838c1a1d3', 'DISTRICT INSTALLATION 2020/21 – LEO DISTRICT 306 A2', 'The District Installation of Leo District 306 A2 for the year 2020/2021 was gracefully held on the 1st of August 2020 at Aqua Pearl Lake Resort – Moratuwa from 2 pm onwards with the participation of District Governor 2020/2021 Lions District 306 A2, Lion Ajith Liyanage MJF as the Chief Guest of the occasion. The Guest of Honor of the occasion was Multiple District President, Leo Multiple District 306, Leo Champaka Dammage. The newly elected District President, Leo Praminda Vindika along with the appointed board of directors took the oath and were inducted at their due positions. Following the newly inducted board of directors, the elected club presidents of the clubs in the district were also inducted. The Official District Logo for the year 2020/2021 was introduced at the occasion themed as “Inspire Innovation”. The New Year is way different to previous years since the coming year is to be driven into an era of Innovation. The new president is highly focused on a paperless future and thereby as the first step to the coming era, Leo Vindika and his team introduced the Official Directory for the year 2020/2021 as a mobile application going ahead from the manual directory maintained during the previous years. With enthusiasm for the upcoming era of Innovation, we wish the best for our new team!!', 'https://www.facebook.com/media/set/?vanity=vevrasrilanka&set=a.2026563650808728', '2021-02-11 20:20:44', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project602583c89d130', 'A2 CLASSROOM - COUNCIL AND CLUB OFFICERS’ WORKSHOP', 'In order to step up the club administration levels, A2 Classroom – the Council and Club Officers’ Workshop of Leo District 306 A2, was successfully held on the 9th of August 2020 at Camilla School, Mattegoda. Club Presidents, Secretaries, Treasurers, Leo club advisors representing the Leo Clubs and Council Officers of Leo District 306 A2 graced the event with their active participation. Moreover, the guidance and the experience shared by our Past Leo Leaders were undoubtedly inspirational for the future leaders who participated the workshop. This workshop was a great opportunity for our Leos as it provided them with clear guidelines to plan the year. Through the workshop, council and club officers were able to learn about their responsibilities, sharpen up their reporting skills, and learn new techniques. District Contest Director Leo Tharini Subasinghe was the project chairperson of this successful event. Happy Reporting!!! “If everyone is moving forward together, then success takes care of itself.”', 'https://www.facebook.com/leo306a2/posts/10158121494236329', '2021-02-11 20:21:44', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project602583fdc28b6', 'NUMERO UNO 2020 - LEO PRESIDENTS & COUNCIL OFFICERS CAMP', '\r\nThe two days shivering for each and every gasp of sudden cold breeze that almost flush us away. The two days with absolutely no connection to the outside world. The two days we ran from the leeches trying to hang on us every step of the way. Well, it was also the two days where we made countless memories, the two days where we met new faces of our family and made our bonds grow even stronger. Those two days made an impact on who we are and who we can become, for it is us who truly knows the potential hidden in us. So Say it. Together we are all Number One!\r\n\r\nThe evergreen Leos stepped towards yet another memorable experience on the 19th of September which was anexpedition to discover themselves. High up the hills, wrapped up in the cold yet energetic breeze, our spirited Leos arrived at the campsite. On the second day of the camp there were adventure activities to test the confidence level of Leos and rifle shooting took place. It was a great experience and a pleasure for all the participants where everyone enjoyed.', 'https://www.facebook.com/media/set/?vanity=leo306a2&set=a.10158275080436329', '2021-02-11 20:22:37', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project602584390e250', '\"ජොලියට වලියක් - 𝐁𝐚𝐭𝐭𝐥𝐞 𝐨𝐟 𝐭𝐡𝐞 𝐙𝐨𝐧𝐞𝐬\" CHALLENGE #01 - THE DUBBING CHALLENGE', 'The times are surely challenging with the ongoing pandemic but our Leos are determined as always. The project “ජොලියට වලියක් - Battle of Zones” was organized with the prime motive of keeping up the unity among our own Leos and to improve the fellowship. The first challenge of this innovative project was the ‘The Dubbing Challenge’. What the teams were asked to do was to make a creative dubbing video. The topics for each team were selected after an online raffle draw. The raffle draw took place on the 25th of October at 7.30 pm on the google meetup platform in the presence of Team Leaders.\r\n\r\nThen the next task took place. The videos were posted on the district social media platforms and the highest likes and shares were taken into consideration. Points were awarded accordingly and the time was given to the teams till the 8th of November. Apart from that, points were awarded considering the creativity and the quality of the content of the videos. The judging board for the \"Dubbing Challenge\" was Multiple District President - Leo Multiple District 306, Leo Champaka Dammage, Immediate Past District President, Leo Mudith Jayasekara, and Former A2 Leo / Popular YouTuber - \"Siril Ayya\", Eng. (Mr) Janitha Rupasena.\r\n\r\nAfter a challenging round, the most awaited time arrived. Winners for the first challenge was announced. It was Zone C1, led by Leo Dithira Wellappuli which won the dubbing challenge with the highest points. This was only the beginning. The best is yet to come! “There are no secrets to success. It is the result of preparation, hard work, and learning from failure. - Collion Powell - “', 'https://www.youtube.com/watch?v=R_cQBSSwg0c&list=PLibzpNK9Kui7CHYyuegaXciyvcN5rEnz1', '2021-02-11 20:23:37', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project6025845d4cf44', '\"ජොලියට වලියක් - 𝐁𝐚𝐭𝐭𝐥𝐞 𝐨𝐟 𝐭𝐡𝐞 𝐙𝐨𝐧𝐞𝐬\" CHALLENGE #02 - THE SPEAK-UP CHALLENGE', '\r\n\"Every great design begins with an even better story\"\r\n\r\nThe next chapter of the mega virtual webinar was focused on Video Editing techniques. It was successfully concluded on the 23rd of November 2020.\r\n\r\nMany factors go into creating the perfect marketing video. Those basic skills and tips were shared with the clubs during this phase of the webinar. The entire webinar series was a great success and became a knowledge hub for the Leos to share each other\'s experiences and ideas. The feedback from the participants proved the end of yet another successful and innovative project by the Leo District 306 A2.', 'https://www.facebook.com/89761571328/posts/10158404485851329/', '2021-02-11 20:24:13', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project602584d689f0f', 'DESIGNERS\' CIRCLE - PHASE 01', 'Designers’ Circle is the mega virtual webinar organized by the Leo District 306 A2 to assist all the clubs in the District related to IT and PR activities for the first time in the history of Leoism.\r\n\r\nThe first phase of this event took place on the 8th of November 2020 from 7.30 pm onwards via Google Meet platform. Lots of enthusiastic participants were there at this event and step by step learning was given to them regarding the flyer designing process by the experienced IT team members. It was a practical session where they gave a complete understanding regarding the tools, logos to use, how to use them, and many other proven techniques that professionals use to make their flyers pop. All the resources related to this useful session were shared among the participants at the end of the event.', 'https://www.facebook.com/leo306a2/posts/10158355466781329', '2021-02-11 20:26:14', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project602585063a86f', 'DESIGNERS\' CIRCLE - PHASE 02', '\"Every great design begins with an even better story\" The next chapter of the mega virtual webinar was focused on Video Editing techniques. It was successfully concluded on the 23rd of November 2020.\r\n\r\nMany factors go into creating the perfect marketing video. Those basic skills and tips were shared with the clubs during this phase of the webinar. The entire webinar series was a great success and became a knowledge hub for the Leos to share each other\'s experiences and ideas. The feedback from the participants proved the end of yet another successful and innovative project by the Leo District 306 A2.', 'https://www.facebook.com/leo306a2/posts/10158427306251329', '2021-02-11 20:27:02', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project6025853cb00d8', 'RENAISSANCE - SERIES OF VIRTUAL ORIENTATION', 'It is important to have a good view of the roles and obligations assigned to Leos in order to achieve the peak of achievement. Renaissance is a modern approach under the new slogan of \"Inspire Innovation\" to improve the comprehension of Leoism and Lionism among fellow Leos. The programme organized by the Orientation Committee of Leo District 306 A2, consists of two series, each of which has several stages. For all the club executive officers and board of directors of the Leo District 306 A2, series I was held. The history of Leoism and Lionism, the uniqueness of the Leo multiple districts, basic administration, Lapel Pins, Badges, and Lions Global Causes, collaborative Kahoot session regarding Leoism, Lionism, and general knowledge issues, the exceptional reasons for linking hands with the most popular voluntary service and many other topics were addressed in series I.\r\n\r\nPhase I of Renaissance for zone A1, phase II for zones A2, B1, and B2, phase III for zones B1, C1, and C2 were conducted successfully on the 1st, 4th, and 12th November respectively enhancing the utmost understanding of the Leiosm among the participants. Series II of the Renaissance will be held aiming all the new Leos of the Leo District 306 A2.', 'https://www.facebook.com/leo306a2/photos/pcb.10158366227896329/10158366227671329/?__cft__[0]=AZWRh1-cZhWbtSguR9HSYWfioOEawdUDcf6ST0-m2BJm188UEqiq4brL6sYyllR7Nb4Qo_SGffJbwoFpgiTmetSyi3ry2nPqfTQN6ohD0QLYlBbjbg9mkLCwznMn9FK-ndlpIx1ketFxt0C1wY-yjjsoBqMfrpP7UvCsb40yHRPYH5DZjgy-WDS1kJwobgdA0N8&__tn__=*bH-R', '2021-02-11 20:27:56', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project60258560f1327', 'INTERNATIONAL LEO DAY CELEBRATION', 'Leoism provides our youth with opportunities to use their voice as well as their energy to shape the community, question social norms, and promote the values we all hold so dear. There are a lot of ways youth can give back to their community, but being a Leo is much more than just community service.\r\n\r\nThe 6 Leo Districts of Leo Multiple District 306, Sri Lanka joined hands together to celebrate the 63rd International Leo Day on Dec 05th, 2020. A series of religious events were organized at 15 places around the country to commemorate the Leo Day with the intention of invoking blessings to our own Leos and Lions and to bless the whole world to come out safely from the Covid-19 pandemic situation. As being part of this celebration we, Leos of Leo District 306 A2 celebrated International Leo Day and organized religious activities at St. Mary\'s Church, Dehiwala and Bellanvila Raja Maha Viharaya, Boralesgamuwa.', 'https://www.facebook.com/media/set/?vanity=leomd306&set=a.10158707390448672', '2021-02-11 20:28:32', 'Admin', 'data:image/jpg;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project60258585e9f05', 'INSIGHT - THE ART OF RAISING FUNDS', 'Fundraising is indeed a challenge for a Leo club. Needless to say, the hardships caused in the age of pandemic had made this a daunting task, which is almost impossible. But as Leos, we are in continuous search of ways and means to tackle the problems and get the best out of them rather than limiting our capacities. Therefore the Fundraising Team of Leo District 306 A2 organized the project ‘iNSIGHT’ to provide Leos with insight into how to do effective fundraisers amidst the pandemic. The webinar was held on 13th December 2020 with the participation of PDP Lion Isuru Senadeera and Zone Director of Zone C2 Leo Dulan Wickramarathne as the facilitators.\r\n\r\nAs a Past District president, Lion Isuru Senadeera emphasized how the clubs can create an annual financial plan by incorporating the lessons learned from the previous years and shared new and innovative ways of conducting the fundraisers. Leo Dulan conducted his session by educating leos on different fundraising techniques including event registration, partnering with the businesses, event advertisements and the novel method of crowdfunding which gained the attention of many who participate in the webinar. The insight team delivered a fruitful session for all the Leo club members proving that fundraising is an art that should be mastered through strategic and tactful thinking.', 'https://fb.watch/2lUEJA09gf/', '2021-02-11 20:29:09', 'Admin', 'data:image/png;base64,');
INSERT INTO `projects` (`id`, `project_name`, `description`, `fb_link`, `published_date`, `published_by`, `image_base64`) VALUES
('project602585b31377f', 'MADE IN SRI LANKA - SESSION 01', 'MADE IN SRI LANKA, a program embracing change, highlighting the importance of creativity is a volunteer-led initiative by Leo District 306 A2. Keeping up with the theme of our District President Leo Praminda Vindika for the Leoistic year 2020/2021, the main goal behind introducing this initiative is to bring out the new ideas or concepts for the present issues that we as a nation face. The specialty of this program is to not only create new products but also to motivate and inspire young minds to think and act differently and also to provide them with a platform to showcase their talents and to encourage them to present their skills out to the world.\r\n\r\nAs the stepping stone for this gigantic concept of bringing out the talents of youth whilst inspiring innovation, a webinar on ‘Unleash the young innovator inside you towards an innovative Sri Lanka’ was organized by the team Made in Sri Lanka of Leo District 306 A2 on the 18th of December 2020 with the presence of a well-known, serial innovator and recognized entrepreneur, Mr. Heminda Jayaweera. He is the recipient of the prestigious Eisenhower Fellowship for the year 2020, also holds the position of Chief Operating Officer of SLINTEC, the pioneer Nanotech and Advanced Research Facility in Sri Lanka. He is also a serial Innovator and Entrepreneur and co-founder of Venture Frontier, Jendo and Thuru. The whole session was definitely very inspiring and encouraging and he ended his presentation with a high note stating that Vision, Passion and Discipline are the three most essential characteristics that an entrepreneur needs to have. It was definitely a very inspiring session that polished our knowledge on entrepreneurship and innovation definitely encouraging us to put forward our new creative ideas to the world!', 'https://www.facebook.com/watch/live/?v=763977474207312&ref=watch_permalink', '2021-02-11 20:29:55', 'Admin', 'data:image/jpeg;base64,');
COMMIT;

